import React from 'react';
import LoginForm from './LoginForm'
class LogInPage extends React.Component{
    render(){
        return(
            <div className = 'row'>
                <div className = 'col-md-4 col-md-offset-4'>
                    <LoginForm />

                </div>

            </div>
        )
    }
}
